import React from 'react';
import List from './List';
import './Main.css';

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            links: [],
        }
    }
    render() {
        return (
            <main>
                <div class="row my-5">
                    <div class="col">
                        <ul class="list-group">
                            <List links={this.state.links}/>
                        </ul>
                    </div>
                </div>
            </main>
        );
    }
}
